    [],nt"num_tags": 0,nt"name": "afsc-nmml-cetacean-assessment-and-ecology-program-humpback-whale-catalog",nt"isopen":
    false,nt"url": null,nt"notes": "Since 1980, the Cetacean Assessment and
    Ecology Program of the National Marine Mammal Laboratory has been collecting photos
    of humpback whales (Megaptera novaeangliae) in Alaskan waters.  Photo-identification
    is a useful method to gain insight into stock structure, life history, habitat use
    and movements.  Some of the images were collected during humpback whale specific
    projects while others have been documented on an opportunistic basis.  Photos have
    been collected within Southeast Alaska, along the Alaskan Peninsula, Kodiak Island,
    the Gulf of Alaska and Bering Sea sides of the Aleutian Chain, as well as, the Bering
    Sea, Bering Strait and Chukchi Sea.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
